#!/usr/bin/python3

# Préparation pour retro_03_tf.py

from descente import *


# Fonction tanh
# sa dérivée tanh'(x) = 1 - tanh(x)**2
def tanh(x):
    E = np.exp(-2*x)
    return (1-E)/(1+E)

# Fonction sigma
def sigma(x):
    return 1/(1+np.exp(-x))

# Fonction heaviside
# définie dans 'descente'
def heaviside(x):
    return np.heaviside(x,1)

def relu(x):
    return np.maximum(x,0)   


# fonction vaut 1 sur [3,5] et 0  sur [0,2] et [6,8] ailleurs
carres_rouges = list(np.linspace(3,5,10))
ronds_bleus   = list(np.linspace(0,2,10)) + list(np.linspace(6,8,10))

# Fonction produite par le neurone
def f(x,poids,phi):
    a1,b1,a2,b2,a3,b3,c3 = poids
    S1 = phi(a1*x+b1) # sortie de premier neurone
    S2 = phi(a2*x+b2) # sortie du second neurone
    val  = phi(a3*S1+b3*S2+c3)   # mettre phi
    return val


